import React from 'react';
import './Buscar.css';
const Buscar = () => {
  return (
    <div>
      <h1>Página de Buscar</h1>
      <p>Aquí puedes buscar campañas relacionadas a diferentes categorías.</p>
      <ul>
        <li>Campaña de Educación</li>
        <li>Campaña de Salud</li>
        <li>Campaña de Medio Ambiente</li>
      </ul>
    </div>
  );
};

export default Buscar;
